import React from "react";


const About = () => {
    return (
        <div>
        <h1>A propos</h1>
        <p>
            Kasa est une plateforme de location de logements de particulier à particulier. Elle permet de trouver un logement à louer en France.
        </p>
        </div>
    );
    }

    export default About;
